package day_19_Loops;

public class Do_While_Run_Ones {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		// in this example code will run ones and leave the loop body
		
		
		
		int count = 10;
		do {
			System.out.println("Count: "+count);
			count++;
		}while(count <=5);
		
		
	}

}
